import React from 'react';
import { BrowserRouter as Router, Route } from 'react-router-dom';
import Dashboard from '.components/Dashboard';

const App = () => {
  return (
    <Router>
      <div>
        <Route path="/" component={Dashboard} />
      </div>
    </Router>
  );
};

export default App;
